import React from 'react';

const Post = (props) =>{
    let post=props.post;
    return(
        <div id={`post ${props.id}`} className="post">
            {post.title}
            {post.date.toString()}
            {post.content.slice(0,Math.min(100,post.content.length))}
        </div>
    )
}

export default Post;
